import React, { Component } from "react";
import {

  View,
  Image,
  ImageBackground,
  Text,
  ActivityIndicator,
  TextInput,
  TouchableOpacity
} from "react-native";
import styles from './styles';
import Navbar from "../Navbar";

function Test(props) {
  return (<>
    <View style={styles.container}>
      <View style={styles.image1Stack}>
        <ImageBackground
          source={require("../../../assets/images/lettuce1.jpg")}
          resizeMode="contain"
          style={styles.image1}
          imageStyle={styles.image1_imageStyle}
        >
          <View style={styles.group}>
            <View style={styles.back1}>
              <Text style={styles.loginTitle}>LOGIN</Text>
              <ActivityIndicator
                style={styles.activityIndicator}
              ></ActivityIndicator>
              <Text style={styles.name}>Name</Text>
              <View style={styles.inputNameStack}>
                <View style={styles.inputName}></View>
                <TextInput
                  placeholder="Username"
                  style={styles.placeholderName}
                ></TextInput>
              </View>
              <Text style={styles.password}>Password</Text>
              <View style={styles.inputPasswordStack}>
                <View style={styles.inputPassword}></View>
                <TextInput
                  placeholder="Password"
                  style={styles.placeholderPassword}
                ></TextInput>
              </View>
              <TouchableOpacity
                onPress={() => props.navigation.navigate("Login3")}
                style={styles.button}
              >
                <Text style={styles.submit}>submit</Text>
              </TouchableOpacity>
            </View>
          </View>
        </ImageBackground>
        <Navbar></Navbar>
      </View>
    </View>
  </>);
}


export default Test;
